(34, 10, '_income_feature_image', 'field_5491cc97fb84b'),
(35, 10, 'income_section_title', 'How You Can Boost Your Income'),
(36, 10, '_income_section_title', 'field_5491cd52fb84c'),
(37, 10, 'income_section_description', 'Whether you\'re a freelance designer, entrepreneur, employee for a company, code hobbyist, or looking for a new career — this course gives you an immensely valuable skill that will enable you to either:'),
(38, 10, '_income_section_description', 'field_5491cd79fb84d'),
(39, 10, 'reason_1_title', 'Make money on the side'),
(40, 10, '_reason_1_title', 'field_5491cdb4fb84e'),
(41, 10, 'reason_1_description', 'So you can save up for that Hawaiian vacation you’ve been wanting, help pay off your debt, your car, your mortgage, or simply just to have bonus cash laying around.'),
(42, 10, '_reason_1_description', 'field_5491cdc8fb84f'),
(43, 10, 'reason_2_title', 'Create a full-time income'),
(44, 10, '_reason_2_title', 'field_5491cdd9fb850'),
(45, 10, 'reason_2_description', 'WordPress developers have options. Many developers make a generous living off of creating custom WordPress themes and selling them on websites like ThemeForest. Freelance designers and developers can also take on WordPress projects and make an extra $1,000 - $5,000+ per month.'),
(46, 10, '_reason_2_description', 'field_5491cdedfb851'),
(47, 10, 'who_feature_image', '17'),
(48, 10, '_who_feature_image', 'field_5491e6dc760ab'),
(49, 10, 'who_section_title', 'Who Should Take This Course?'),
(50, 10, '_who_section_title', 'field_5491e6c4760aa'),
(51, 10, 'who_section_body', '<h3>Graphics &amp; Web Designers</h3>\nGraphic designers are extremely talented, but ask them to code their designs and they\'ll freeze up! This leaves them with no other choice but to hire a web developer. Any professional graphic designers knows web developers can be expensive.\n\nIf you’re a designer, learning to code your own WordPress websites can change your business entirely! Now, not only are you a great designer, but you\'re a skillful developer, too! This puts you in a position to<strong>make an extra $1,000 - $5,000 per project.</strong>\n<h3>Entrepreneurs</h3>\nEntrepreneurs have big dreams, and in many cases, shoestring budgets. In order to survive in the cut-throat world of the Startup company, it’s a necessity to have a world-class website. However, world-class websites come with a large price tag.\n\nIf you can learn how to build a high-quality startup website by yourself, then you’ve just saved yourself a lot of cash, <strong>tens of thousands of dollars in many cases.</strong>\n<h3>Employees</h3>\nAny company knows the education &amp; training of their employees is key to a thriving team.\n\nDepending on the type of company you work for, if you understand how to code, and can develop CMS driven websites, that gives you <strong>negotiating power for a better position, or a higher salary.</strong>\n<h3>Code Hobbyists</h3>\nIt’s fun to learn challenging new skills. Code hobbyists can add dynamic websites to their arsenal of tools to play with — you can even <strong>sell WordPress themes and plugins for cash!</strong> The possibilities are truly endless.\n<h3>People Looking for a New Career</h3>\nAre you out of work? Looking for a more rewarding job? Desire a career that can allow you to work almost anywhere in the world? Becoming a Web Developer might be the answer for you.\n\n<strong>Web developers are paid well, anywhere from $33,000 to more than $105,000 per year.</strong> They get to work at amazing companies that are changing the world, or they enjoy the ability to start their own companies, become location-independent and work from home, from coffee shops, in an airplane, on the beach, or wherever they want!'),
(52, 10, '_who_section_body', 'field_5491e701760ac'),
(53, 10, 'features_section_image', '28'),
(54, 10, '_features_section_image', 'field_5491f341b5296'),
(55, 10, 'features_section_title', 'Course Features'),
(56, 10, '_features_section_title', 'field_5491f366b5297'),
(57, 10, 'features_section_body', ''),
(58, 10, '_features_section_body', 'field_5491f37fb5298'),
(59, 10, 'project_feature_title', 'Final Project Features'),
(60, 10, '_project_feature_title', 'field_549201a78cb92'),
(61, 10, 'project_feature_body', 'Throughout this entire course, you work towards building an incredibly beautiful website. Want to see the website you are going to build? You\'re looking at it! The website you\'re using right now is the website you will have built entirely by yourself, by the end of this course.'),
(62, 10, '_project_feature_body', 'field_549201b88cb93'),
(63, 10, 'instructor_section_title', 'Your Instructor'),
(64, 10, '_instructor_section_title', 'field_549210aade2e9'),
(65, 10, 'instructor_name', 'Brad Hussey'),
(66, 10, '_instructor_name', 'field_549210c8de2ea'),
(67, 10, 'bio_excerpt', 'A highly skilled professional, Brad Hussey is a passionate and experienced web designer, developer, blogger and digital entrepreneur.'),
(68, 10, '_bio_excerpt', 'field_549210ddde2eb'),
(69, 10, 'full_bio', 'Hailing from North Of The Wall (Yellowknife, Canada), Brad made the trek to the Wet Coast (Vancouver, Canada) to educate and equip himself with the necessary skills to become a spearhead in his trade of solving problems on the web, crafting design solutions, and speaking in code.\n\nBrad\'s determination and love for what he does has landed him in some pretty interesting places with some neat people. He\'s had the privilege of working with, and providing solutions for, numerous businesses, big & small, across the Americas.\n\nBrad builds custom websites, and provides design solutions for a wide-array of clientele at his company, Brightside Studios. He regularly blogs about passive income, living your life to the fullest, and provides premium quality web design tutorials and courses for tens of thousands of amazing people desiring to master their craft.'),
