(224, 10, 'bio_excerpt', 'A highly skilled professional, Brad Hussey is a passionate and experienced web designer, developer, blogger and digital entrepreneur.'),
(225, 10, '_bio_excerpt', 'field_549210ddde2eb'),
(226, 10, 'full_bio', 'Hailing from North Of The Wall (Yellowknife, Canada), Brad made the trek to the Wet Coast (Vancouver, Canada) to educate and equip himself with the necessary skills to become a spearhead in his trade of solving problems on the web, crafting design solutions, and speaking in code.\n\nBrad\'s determination and love for what he does has landed him in some pretty interesting places with some neat people. He\'s had the privilege of working with, and providing solutions for, numerous businesses, big & small, across the Americas.\n\nBrad builds custom websites, and provides design solutions for a wide-array of clientele at his company, Brightside Studios. He regularly blogs about passive income, living your life to the fullest, and provides premium quality web design tutorials and courses for tens of thousands of amazing people desiring to master their craft.'),
